                  </NavLink>

                  <NavLink to="/account" activeStyle>
                     Account
                  </NavLink>


                  <NavLink to="/login" activeStyle>
                      Login
                  </NavLink>

                  <NavBtn>
                      <NavBtnLink to="/register">Sign Up</NavBtnLink>                
                  </NavBtn>
              </NavMenu> 
             </Nav> 
          </>
      );
  };
